import { FunctionComponent, useContext } from "react";
import { Modal } from "react-bootstrap";
import { SiteTheme } from "../App";
import Card from "../interfaces/card";

interface ColorModalProps{
    show: boolean;
    onHide: Function;
    cardInfo: Card;
    setChange: Function;
    change: boolean
}

const ColorModal: FunctionComponent<ColorModalProps> = ({show,onHide,cardInfo,change,setChange}) => {
    const theme = useContext(SiteTheme);
    return <>
    <Modal
        show={show}
        onHide={() => onHide()}
        // size="sm"
        aria-labelledby="contained-modal-title-vcenter"
        centered
    >
        <Modal.Header style={{ color: theme.color, backgroundColor: theme.background }} closeButton>
            <Modal.Title id="contained-modal-title-vcenter">
            </Modal.Title>
        </Modal.Header>
      <Modal.Body style={{ color: theme.color, backgroundColor: theme.background }}>
        <div id="colorBtns" style={{backgroundColor: theme.background, color: theme.color}}>
            <button style={{margin:"10px", width:"60px", height:"27px", backgroundColor:"black"}} className="btn"></button>
            <button style={{margin:"10px", width:"60px", height:"27px", backgroundColor:"black"}} className="btn"></button>
            <button style={{margin:"10px", width:"60px", height:"27px", backgroundColor:"black"}} className="btn"></button>
            <button style={{margin:"10px", width:"60px", height:"27px", backgroundColor:"black"}} className="btn"></button>
            <button style={{margin:"10px", width:"60px", height:"27px", backgroundColor:"black"}} className="btn"></button>
            <button style={{margin:"10px", width:"60px", height:"27px", backgroundColor:"black"}} className="btn"></button>
        </div>
       </Modal.Body>


    </Modal>
    </>
}

export default ColorModal;
